class Main extends PureComponent {
    render() {
        return (
            <div className={"main-container"}>
                <div className={"tabs"}>
                    <p className={"tab"}>Dine in</p>
                </div>
                <div>
                    <button className={"button"}>Add Table</button>
                </div>
                <div className={"tables"}>
                    <h1>The area for table chart</h1>
                </div>
            </div>
        );
    }
}

Main.propTypes = {};

export default Main;
